import React from 'react';
import style from './Home.module.scss';
import Toggle from 'react-bootstrap-toggle';



const Home = () => {
    return (
    <div>
        <div id={style.star1}></div>
        <div id={style.star2}></div>
        <div id={style.star3}></div>
        <div id={style.star4}></div>
        <div id={style.sun}></div>
        {/* <div id={style.mercury}></div> */}
        <Toggle
          onClick={this.onToggle}
          on={<h2>ON</h2>}
          off={<h2>OFF</h2>}
          size="xs"
          offstyle="danger"
          active={this.state.toggleActive}
        />
    </div>

    );
};

export default Home;
